import './popUpMenu.css'

export default function PopUpMenu({name}){
    return(
        <form className="popUpMenu">
            <p className="popUpMenu__title">Название фильма{name}</p>
            <p className="popUpMenu__sum">Цена 400руб.</p>
            <input type="text" className="popUpMenu__input"/>
            <p className="popUpMenu__description">Дополнительная информация и бронирование билетов по телефону +7 800 535-35-35</p>
            <button className="popUpMenu__buy">Купить</button>
        </form>
    )
}
